create table ulkeler
(
    id   int auto_increment
        primary key,
    code char(2)      null,
    en   varchar(100) null,
    de   varchar(100) null,
    es   varchar(100) null,
    fr   varchar(100) null,
    it   varchar(100) null,
    ru   varchar(100) null,
    tr   varchar(100) null,
    constraint ulkeler2_code_uindex
        unique (code)
)
    charset = utf8;

